import React from "react";
import { NavLink } from "react-router-dom";
function DashboardUL({ img, title, path, element }) {
  return (
    <li  className="dashboardurl">
      <img src={img} alt="img" />{" "}
      <NavLink
        //  activeStyle={{ color: 'red' }}
        // style={({ isActive }) => isActive ? { color: "red" } : { color: "blue" }}
        className={`link link-active ${isActive  => (isActive ? "link-active" : "linkk")} `}
        to={path}
      >
        {title}
      </NavLink>
    </li>
  );
}

export default DashboardUL;
